import React from 'react';
import { useLocation } from 'react-router-dom';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const defaultTheme = createTheme();

const Homepage = () => {
  const location = useLocation();
  const { state } = location;

  return (
    <ThemeProvider theme={defaultTheme}>
      <Paper elevation={3} style={{ padding: 16, margin: 'auto', maxWidth: 600 }}>
        <Box
          sx={{
            my: 8,
            mx: 4,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            backgroundColor: (t) =>
              t.palette.mode === 'light' ? t.palette.grey[50] : t.palette.grey[900],
            boxShadow: defaultTheme.shadows[6],
            padding: defaultTheme.spacing(4),
            position: 'relative',
            zIndex: 0,
            overflow: 'hidden',
            backgroundImage: 'radial-gradient(125% 125% at 50% 10%, #000 40%, #63e 100%)',
            height: '100vh', // Adjust height based on your layout
          }}
        >
          <Typography component="h1" variant="h5">
            Submitted Details
          </Typography>
          <Typography variant="body1" gutterBottom>
            Name: {state.name}
          </Typography>
          <Typography variant="body1" gutterBottom>
            Email: {state.email}
          </Typography>
          <Typography variant="body1" gutterBottom>
            Age: {state.age}
          </Typography>
          {state.attendingWithGuest && (
            <Typography variant="body1" gutterBottom>
              Guest Name: {state.guestName}
            </Typography>
          )}
        </Box>
      </Paper>
    </ThemeProvider>
  );
};

export default Homepage;
